    event.preventDefault();
    // handle form submission here
    history.push('/home');
  }

  return (
    <form
      className="w-full max-w-sm bg-slate-300 shadow-lg rounded-xl p-5 mt-20"
      onSubmit={onSubmit}
    >
      {/* form content */}
    </form>
  );
};

export default Signup;
